  [],\n\t\"revision_timestamp\": \"2016-02-26T22:04:24.754047\",\n\t\"name\": \"implementation-of-prognostic-methodologies-to-cryogenic-propellant-loading-test-bed\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Prognostics methodologies determine the
  health state of a system and predict the end of life and remaining useful life.
  This information enables operators to take maintenance related decisions, thus effectively
  streamlining operational and mission-level activities. Prognostics testbeds help
  in the prototyping, development, and maturation of prognostic technologies. In this
  work, we present a prognostics testbed for pneumatic valves. Pneumatic valves are
  critical components in many industrialrnprocesses, and the testbed will be used
  to showcase how remaining life prediction works in the context of cryogenic refueling
  operations. The testbed allows for the injection of time-varying leaksrnwith specified
  damage progression profiles in order to emulate common valve faults. In addition,
  the testbed contains a battery used to power some components, allowing the study
  of the effects of battery degradation on the operation of the valves. Prognostic
  algorithms will utilize sensor data collected from the different transducers in
  order to estimate component health and make life predictions, based on mathematical
  models describing the underlying physics of component degradation and employing
  a Bayesian filtering algorithm for state-parameter estimation fromrnwhich life predictions
  are made.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
